import React from 'react';

const HowItWorks = () => {
    return (
        <section className="how-it-works">
            <h2>How It Works</h2>
            <p>Our process is simple and effective. Here's how we do it:</p>
            <ol>
                <li>Step 1: Initial Consultation</li>
                <li>Step 2: Customized Plan</li>
                <li>Step 3: Implementation</li>
                <li>Step 4: Ongoing Support</li>
            </ol>
        </section>
    );
};

export default HowItWorks;
